'''Garden suppliers''' run the [[Garden Centre]], stores that sells various bagged [[plant]]s and [[trees]] for [[player-owned house]]s. They can be found wandering around [[Falador Park]] and the [[Farming Guild]].

Their stock level is specific to each single world, so once they run out of stock you can buy more bagged plants by [[World switching|hopping worlds]].

